import React, {useEffect, useState} from 'react'
import {AgGridReact} from 'ag-grid-react'
import 'ag-grid-community/styles//ag-grid.css';
import 'ag-grid-community/styles//ag-theme-alpine.css';
function App() {
const [users, setUsers] = useState([])
const fetchuser = async () =>{
 const response = await fetch("https://jsonplaceholder.typicode.com/users");
    const repsonseJson = await response.json();
    setUsers(repsonseJson.results);
}
  useEffect(() =>{
      fetchuser();
      console.log(users)
  }, []);

  const column = [
    {field : 'name', headerName : "Name" , width :100},
    {field : 'username', headerName : "Age"},
  ]
  return (
    <div className='ag-theme-alpine' style={{height:'250px',margin : "0 auto"}}> <AgGridReact rowData={users} columnDefs={column} /></div>
  );
}

export default App;
